function Cards(pokemons) {
  return (
    <div className='cards'>
      {console.log("pokemons in cards", pokemons)}
       {pokemons.pokemons.map(function (pokemon){
      return (<div>
        <h3>{pokemon.name}</h3>
        <img className='imagem' src={pokemon.image}></img>

      </div>)}
      )
      }


    </div>
  )
}

export default Cards
